import React from 'react'
import Layout from './hoc/Layout/Layout'

function App() {
  return (
    <Layout>

      <div style={{width: 400, border: '1px solid black'}}></div>
        <h1>Layout works</h1>
    </Layout>
  );
}

export default App;
